import CustomerItem from "../CustomerItem/CustomerItem";
import "./CustomerList.css";

const customerData = [
    {
        id: 1,
        customerName:"Kadircan Kaymakcı"
    },
    {
        id: 2,
        customerName:"Eren Andinç"
    },
    {
        id: 3,
        customerName:"Furkan Kaplan"
    }
]

function CustomerList() {
    return (
        <ul className="customer-list">
            {customerData.map((customer) => (<CustomerItem customer={customer} key={customer.id} />))}
            
        </ul>
    );
}
export default CustomerList;
